snippet.description:
What a ton of fun!  I went out to the park for another run with the JPC-12 and it was a blast.  100 total contacts in 47 min.  
The contacts were fast and the pileup intense.  @K4BDX, Brandon, from NC PASSED HIS EXTRA, and @K4MHD told me his wife enjoys my videos because it looks like I'm having fun. Well Rob, tell her I am having more fun than any old retired guy should have.

#pota 
#radioantenna 
#parksontheair 
#hamradio 
#radiocommunication 
#antenna 
#hamradioantenna 
#portableradio 

Equipment used:
 @YaesuUSAOfficial  FT-891
 @ecoworthy_official  20ah Battery
 @ABRindCoax  Coax
 @LDGElectronics-2   Z-100 plus tuner
 @ParksOnTheAir  
 @smartlogger  
 @JamesHannibalKH2SR  Quirky QRP Mammoth Mat
 @GigaPartsHuntsville  
 @DXEngineering ​
 @corallee8451 JPC-12 antenna

 I appreciate you watching and hope to hear you on the air, FROM A PARK, soon.
73,
Paul

