I went out to US-2357, Bogue Chitto State Park for a "relaxing" activation. Turns out it was really exciting due to the great DX on 10m and 15m.  Fantastic contacts from France, Costa Rica, England, Germany, Spain, Brazil, etc.  It was awesome!  Come along for the ride.
