It's one of those IYKYK situations.  Activating Parks on the Air is so much fun.  I've done over 200 activations and it never gets old.  In fact the more experience I have, ever antenna, ever park, every band condition, brings new excitement to the activation
This was my 97th activation at US-10562. I'm in search of #100.
Come along for some 15m & 20m fun!
